    casadi_copy(d_nlp.lam, 84, d->dlam);
    casadi_clear(d->dx, 66);
    /* Increase counter */
    iter_count++;
    /* Solve the QP */
    d->arg[0] = 0;
    d->arg[1] = 0;
    d->arg[2] = 0;
    d->arg[3] = 0;
    d->arg[4] = 0;
    d->arg[5] = 0;
    d->arg[6] = 0;
    d->arg[7] = 0;
    d->arg[8] = 0;
    d->arg[9] = 0;
    d->arg[10] = 0;
    d->arg[11] = 0;
    d->arg[0] = d->Bk;
    d->arg[1] = d->gf;
    d->arg[7] = d->dx;
    d->arg[8] = d->dlam;
    d->arg[9] = d->dlam+66;
    d->arg[5] = d->lbdz;
    d->arg[6] = d->ubdz;
    d->arg[2] = d->Jk;
    d->arg[3] = d->lbdz+66;
    d->arg[4] = d->ubdz+66;
    d->res[0] = 0;
    d->res[1] = 0;
    d->res[2] = 0;
    d->res[3] = 0;
    d->res[0] = d->dx;
    d->res[3] = d->dlam;
    d->res[2] = d->dlam+66;
    ret = casadi_f8(d->arg, d->res, d->iw, d->w, 0);
    if (ret == -1000) return -1000;
